import './App.css';
import Movie from './components/Movies';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {


  return (
    <div className="App">

        <Router>
          <Routes path="/" element={<App />} />
          <Routes path="/movie" element={<Movie />} />
        </Router>


    </div>
  );
}

export default App;
